import React from 'react';
class Parent extends React.Component{
    render(){
        const array1=["Adam","John","Peter"]
        return(
            <div>
                {
                    array1.map(x=><h1>{x}</h1>)
                }
            </div>
        )
    }
}
export default Parent;
